PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE pessoas (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    nome TEXT NOT NULL,
    cpf TEXT,
    token TEXT UNIQUE,
    ativo INTEGER DEFAULT 1,
    notas TEXT,
    created_at TEXT DEFAULT CURRENT_TIMESTAMP,
    updated_at TEXT DEFAULT CURRENT_TIMESTAMP
);
CREATE TABLE emails (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    pessoa_id INTEGER NOT NULL,
    email TEXT NOT NULL UNIQUE,
    principal INTEGER DEFAULT 0,
    FOREIGN KEY (pessoa_id) REFERENCES pessoas(id) ON DELETE CASCADE
);
CREATE TABLE filiacoes (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    pessoa_id INTEGER NOT NULL,
    ano INTEGER NOT NULL,
    categoria TEXT NOT NULL,
    valor INTEGER,
    data_pagamento TEXT,
    metodo TEXT,
    pagbank_id TEXT,
    telefone TEXT,
    endereco TEXT,
    cep TEXT,
    cidade TEXT,
    estado TEXT,
    pais TEXT,
    profissao TEXT,
    formacao TEXT,
    instituicao TEXT,
    created_at TEXT DEFAULT CURRENT_TIMESTAMP, seminario INTEGER DEFAULT 0, status TEXT DEFAULT 'pendente', pagbank_order_id TEXT, pagbank_charge_id TEXT, pagbank_boleto_link TEXT, pagbank_boleto_barcode TEXT, data_vencimento TEXT,
    FOREIGN KEY (pessoa_id) REFERENCES pessoas(id) ON DELETE CASCADE,
    UNIQUE(pessoa_id, ano)
);
CREATE TABLE cadastrados (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            nome TEXT NOT NULL,
            email TEXT NOT NULL,
            cpf TEXT,
            telefone TEXT,
            endereco TEXT,
            cep TEXT,
            cidade TEXT,
            estado TEXT CHECK(length(estado) <= 2 OR estado IS NULL),
            pais TEXT DEFAULT 'Brasil',
            profissao TEXT,
            formacao TEXT,
            instituicao TEXT,
            categoria TEXT CHECK(categoria IN ('estudante', 'profissional_nacional', 'profissional_internacional', 'participante_seminario', 'cadastrado')),
            seminario_2025 BOOLEAN DEFAULT 0,
            data_cadastro DATETIME DEFAULT CURRENT_TIMESTAMP,
            data_atualizacao DATETIME,
            token TEXT UNIQUE,
            token_expira DATETIME,
            observacoes TEXT,
            observacoes_filiado TEXT
        );
CREATE TABLE pagamentos (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            cadastrado_id INTEGER NOT NULL REFERENCES cadastrados(id),
            ano INTEGER NOT NULL,
            valor DECIMAL(10,2) NOT NULL,
            status TEXT DEFAULT 'pendente' CHECK(status IN ('pendente', 'pago', 'cancelado', 'expirado')),
            metodo TEXT CHECK(metodo IN ('pix', 'boleto', 'cartao', 'manual')),
            pagbank_order_id TEXT,
            pagbank_charge_id TEXT,
            pagbank_boleto_link TEXT,
            pagbank_boleto_barcode TEXT,
            data_criacao DATETIME DEFAULT CURRENT_TIMESTAMP,
            data_pagamento DATETIME,
            data_vencimento DATETIME,
            UNIQUE(cadastrado_id, ano)
        );
CREATE TABLE log (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            timestamp DATETIME DEFAULT CURRENT_TIMESTAMP,
            tipo TEXT NOT NULL,
            cadastrado_id INTEGER,
            mensagem TEXT
        );
CREATE TABLE campanhas (
            ano INTEGER PRIMARY KEY,
            status TEXT DEFAULT 'aberta',
            created_at DATETIME DEFAULT CURRENT_TIMESTAMP
        , emails_enviados INTEGER DEFAULT 0);
DELETE FROM sqlite_sequence;
CREATE INDEX idx_emails_pessoa ON emails(pessoa_id);
CREATE INDEX idx_filiacoes_pessoa ON filiacoes(pessoa_id);
CREATE INDEX idx_filiacoes_ano ON filiacoes(ano);
CREATE VIEW filiados AS
SELECT
    p.id,
    p.nome,
    p.cpf,
    e.email,
    f.ano,
    f.categoria,
    f.valor,
    f.data_pagamento,
    f.cidade,
    f.estado,
    f.instituicao
FROM pessoas p
JOIN emails e ON e.pessoa_id = p.id AND e.principal = 1
JOIN filiacoes f ON f.pessoa_id = p.id
WHERE f.categoria != 'nao_filiado'
  AND f.valor IS NOT NULL
  AND p.ativo = 1;
CREATE INDEX idx_pagamentos_status ON pagamentos(status);
CREATE INDEX idx_pagamentos_ano ON pagamentos(ano);
CREATE INDEX idx_cadastrados_email ON cadastrados(email);
CREATE INDEX idx_cadastrados_token ON cadastrados(token);
COMMIT;
